import React, { useState } from 'react';

function TodoList(){

    return (
        <div>
      <h1>To Do List</h1>
      <input
        type="text"
        value={newTodo}
        onChange={(e) => {
          setNewTodo(e.target.value);
        }}
      />
      <button onClick={addNewTodo}>추가</button>
      <ul>
        {todoList.map((todo, index) => (
          <li key={index}>
            {todo} <button onClick={() => deleteTodo(index)}>삭제</button>
          </li>
        ))}
      </ul>
    </div>
    )
}
